import React from "react";

export default function Examinations() {
  return (
    <>
      <section className="hiro-section bg-light" id="examination">
        <div className="container mt-3 mb-3">
          <div className="d-flex flex-row align-items-center" />
          <div className="heading mt-2">
            {" "}
            <span className="section-title career-section-title">Examinations</span>{" "}
          </div>
          <div className="row mt-1 g-4 mx-2">
            <div className="col-md-4 mt-2">
              <div className="card p-2">
                <div className="d-flex p-1 px-4 align-items-center">
                  {" "}
                  <span className="square">
                    <img
                      src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6wm9YP1kbpVjs7om_j447yGHTcDWh-J5llQ&usqp=CAU"
                      height={20}
                      width={20}
                      alt="."
                    />
                  </span>{" "}
                </div>
                <div className="email mt-1">
                  {" "}
                  <span>GENERAL INDUSTRY/PRODUCTS EXAM</span>
                  <div className="dummytext mt-1">
                    {" "}
                    <span>Examination Sept 11, 2015</span> <br />
                    <br />
                    <span className="font-weight-bold">
                      Series 7 - General Securities Representative
                    </span>{" "}
                  </div>
                </div>
                {/* <div className="d-flex flex row align-items-center mr-2 mt-2">
                  <div className="icons">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Email Newsletter setup</span>{" "}
                  </div>
                  <div className="icons">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Email Sequence</span>{" "}
                  </div>
                  <div className="icons">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Email Monitization</span>{" "}
                  </div>
                </div> */}
              </div>
            </div>
            <div className="col-md-4 mt-2">
              <div className="card p-2">
                <div className="d-flex p-1 px-4 align-items-center">
                  {" "}
                  <span className="square1">
                    <img
                      src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6wm9YP1kbpVjs7om_j447yGHTcDWh-J5llQ&usqp=CAU"
                      height={20}
                      width={20}
                      alt="."
                    />
                  </span>{" "}
                </div>
                <div className="email mt-1">
                  {" "}
                  <span>STATE SECURITIES LAW EXAM</span>
                  <div className="dummytext mt-1">
                    {" "}
                    <span>Examination Oct 21, 2018</span> <br />
                    <br />
                    <span className="font-weight-bold">
                      Series 63 - Uniform Securities Agent State Law
                    </span>{" "}
                  </div>
                </div>
                {/* <div className="d-flex flex row align-items-center mr-2 mt-2">
                  <div className="icons1">
                    {" "}
                    <i className="fa fa-check-circle" /> <span>Google Ads</span>{" "}
                  </div>
                  <div className="icons1">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Facebook Ads</span>{" "}
                  </div>
                  <div className="icons1">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Linkedin &amp; Twitter Ads</span>{" "}
                  </div>
                </div> */}
              </div>
            </div>
            <div className="col-md-4 mt-2">
              <div className="card p-2">
                <div className="d-flex p-1 px-4 align-items-center">
                  {" "}
                  <span className="square2">
                    <img
                      src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6wm9YP1kbpVjs7om_j447yGHTcDWh-J5llQ&usqp=CAU"
                      alt="."
                      height={20}
                      width={20}
                    />
                  </span>{" "}
                </div>
                <div className="email mt-1">
                  {" "}
                  <span>GENERAL INDUSTRY/PRODUCTS EXAM</span>
                  <div className="dummytext mt-1">
                    {" "}
                    <span>Examination June 1, 2016</span> <br />
                    <br />
                    <span className="font-weight-bold">
                      SIE - Securities Industry Essentials Examination
                    </span>{" "}
                  </div>
                </div>
                {/* <div className="d-flex flex row align-items-center mr-2 mt-2">
                  <div className="icons2">
                    {" "}
                    <i className="fa fa-check-circle" /> <span>SEO audits</span>{" "}
                  </div>
                  <div className="icons2">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>On-Page audits</span>{" "}
                  </div>
                  <div className="icons2">
                    {" "}
                    <i className="fa fa-check-circle" />{" "}
                    <span>Off-Page audits</span>{" "}
                  </div>
                </div> */}
              </div>
            </div>
            <div className="col-md-4 mt-2">
              <div className="card p-2">
                <div className="d-flex p-1 px-4 align-items-center">
                  {" "}
                  <span className="square3">
                    <img
                      src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6wm9YP1kbpVjs7om_j447yGHTcDWh-J5llQ&usqp=CAU"
                      alt="."
                      height={20}
                      width={20}
                    />
                  </span>{" "}
                </div>
